import React from "react";
import './header.css'
import { Link } from 'react-router-dom';

class Header extends React.Component {
    render() {
        return (
            <>
                <div id="header">
                    <h1 id="title">DailyForecast</h1>
                    <div id="container">
                        <input id="searchbar" type="text" placeholder="Enter a city name to look forecasts. (for ex. 'Paris')" />
                        <Link></Link>
                    </div>
                </div>
            </>
        )
    }
}

export default Header
